import 'dashboard.dart';class GetDashboardDataResponse {  String status;  String msg;  Dashboard dashboard;  GetDashboardDataResponse({      this.status,       this.msg,       this.dashboard});  fromJson(dynamic json) {    status = json['status'];    msg = json['msg'];    dashboard = json['Dashboard'] != null ? Dashboard.fromJson(json['Dashboard']) : null;  }  Map<String, dynamic> toJson() {    var map = <String, dynamic>{};    map['status'] = status;    map['msg'] = msg;    if (dashboard != null) {      map['Dashboard'] = dashboard.toJson();    }    return map;  }}